import axios from "axios";
import React, {useState, useEffect} from "react";


const Weather = () => {


    const APIKEY = "1116f4c4e6007e63fa30e4b4bfbd5f43";



    const [ form, setForm ] = useState({
        city: "",
        country: ""
    })

    async function weatherData(e){
        e.preventDefault();
        if(form.city == ""){
            alert("Add values");
        }else{
            const data = await axios.get(
                `https://api.openweathermap.org/data/2.5/weather?q=${city.name},${country.code}&appid=${APIKEY}`
                ).then((res) => console.log(res.json()))

        }
    }


    const handleChange = (e) =>{
        let name = e.target.name;
        let value = e.target.value;

        if(name == "city"){
            setForm({...form, city:value});

        }
        if(name == "country"){
            setForm({...form, country:value});

        }

        console.log(form.city, form.country);
    }


    return (  
        <div>
            <h3>Väder</h3>

            <div className="search">
                <form>
                    <input type="text" name="city" id="city" onChange={e => handleChange(e)}/>
                    <input type="text" name="country" id="country" onChange={e => handleChange(e)} />
                    <button onClick={(e) => weatherData(e)}>Sök</button>
                </form>
            </div>
        </div>

    );
}

export default Weather;
